import React from 'react'
import ListItem from './ListItem'

const Content = ({items}) => {
  return (
    <ul className="list">
       {items.map(item =>(
            <ListItem 
                key={item.id}
                item = {item}
            />
       ))}
    </ul>
  )
}

export default Content
